import React, { useState } from 'react';
import { useGoogleLogin } from '@react-oauth/google';
import { Button, Dialog, DialogActions, DialogContent, DialogTitle, TextField, Typography, Box } from '@mui/material';

function HomePage() {
  const [open, setOpen] = useState(false);
  const [isLogin, setIsLogin] = useState(true); // Stav pro určení, zda se jedná o přihlášení nebo registraci

  const handleLoginSuccess = (credentialResponse) => {
    console.log('Přihlášení/Registrace úspěšná! Credential Response:', credentialResponse);
    // Zpracování přihlášení nebo registrace
  };

  const googleLogin = useGoogleLogin({
    onSuccess: handleLoginSuccess,
    onError: error => console.log(error),
  });

  const handleClickOpen = (login) => {
    setIsLogin(login);
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h4" gutterBottom>
        Vítejte na GymNest
      </Typography>
      <Button variant="outlined" onClick={() => handleClickOpen(true)} sx={{ marginRight: 1 }}>
        Přihlásit se
      </Button>
      <Button variant="outlined" onClick={() => handleClickOpen(false)}>
        Registrovat se
      </Button>
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>{isLogin ? "Přihlášení" : "Registrace"}</DialogTitle>
        <DialogContent>
          <TextField
            autoFocus
            margin="dense"
            id="email"
            label="Emailová adresa"
            type="email"
            fullWidth
            variant="standard"
          />
          <TextField
            margin="dense"
            id="password"
            label="Heslo"
            type="password"
            fullWidth
            variant="standard"
          />
          {isLogin ? null : (
            <>
              <TextField
                margin="dense"
                id="firstname"
                label="Jméno"
                type="text"
                fullWidth
                variant="standard"
              />
              <TextField
                margin="dense"
                id="lastname"
                label="Příjmení"
                type="text"
                fullWidth
                variant="standard"
              />
            </>
          )}
        </DialogContent>
        <DialogActions>
          <Button onClick={googleLogin} variant="contained" style={{ backgroundColor: '#4285F4', color: 'white', marginRight: '8px' }}>
            {isLogin ? "Přihlásit se přes Google" : "Registrovat se přes Google"}
          </Button>
          <Button onClick={handleClose} color="primary">
            {isLogin ? "Přihlásit" : "Registrovat"}
          </Button>
          <Button onClick={handleClose}>Zrušit</Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
}

export default HomePage;
